var shareTips={
	show:function(){
		if(this._getDiv()){
			this._getDiv().style.display='block';
			return;
		}
		var div=document.createElement('div');
		div.id='z-share-overlay';
		div.style.cssText='position:fixed;top:0;left:0;right:0;bottom:0;z-index:255;background:rgba(0,0,0,.6);padding:80px 20px 0;text-align:center;';
		var img=document.createElement('img');
		img.src='data:image/png;base64,';
		img.setAttribute('style','border:0;height:auto;max-width:100%;');
		div.appendChild(img);
		document.body.appendChild(div);
		div.addEventListener('click', shareTips.hide);
	},
	hide:function(){
		var div=shareTips._getDiv();
		if(div){
			div.style.display='none';
		}
	},
	remove:function(){
		var div=shareTips._getDiv();
		if(div){
			div.parentNode.removeChild(div);
		}
	},
	_getDiv:function(){
		var div=document.querySelector('#z-share-overlay');
		return div;
	}
}